HAS 2 MAGAZINES, ADJUSTABLE TRIGGER, PACHMYER COCOBOLO GRIPS (built 1956 1 of 2500 that year) Here a link to a web site dealing with the Sistema Colt;
http://xavierthoughts.blogspot.com/2009/03/colt-sistema.html , Pistol in really great shape
for age. I love the trigger. Adjusted for about 5 I think. New rear adjustable night sights from Kensights ($120 sights)

Looking to sell my very nice AR-15.  It's a custom build using only premium parts.  I originally built this gun for 3 gun competition, and its based more off of the M16 style rather than the M4.  
Specs on the rifle are as follows.

Lower Receiver-
Stag Arms lower receiver;
Palmetto State Armory lower parts kit; 
Magpul MOE grip;
Magpul MOE Rifle stock;
Magpul Enhanced Trigger guard;

Upper receiver-
Spikes Tactical upper receiver;
Custom 17" stainless barrel chambered in .223/5.56 Wylde with rifle length FSGB;
Yankee Hill Machine Phantom muzzle break
Magpul MOE rifle length handguard
WMD NIbX bolt carrier group with NIbX coated hammer;
Daniel Defense fixed rear sight;
standard charging handle (keeping my ambi gunfighter for a pistol build)

The Barrel started its like as a 20" HBAR and I sent it out to Randall over at AR15barrels.com and had him shorten to it 17" crown, re-thread, open the gas port for proper function year round in Wisconsin weather and pin the front sight block.  Once it returned from him i threw it on the lathe at my work and re profiled the barrel from HBAR to a government profile.
All of the barrel parts (Barrel nut, Delta ring, FSGB ect.)  came from Bravo Company Machine.

I built this gun like a tank and stand behind my work.  This isn't my first build, and it's not just slapped together using generic part kits.  A lot of thought has been put into this gun and several people have told me it's the softest shooting AR they have ever shot.
Maybe 100 round have been through it, and the bore is mirror smooth.
Reason I'm selling is, 3gun won't be happening anytime soon and  I am in the process of a 7.62x39 pistol build and wont need 2 toys.  Plus i want a motorcycle...

This Gun will come with 5 Magpul Pmags.  Four 30 rounders (one has a window) and one 40 rounder.
Also 150 round box of 62gr greentip

Price is $950 obo for everything or trade for an older motorcycle.  

Any meet ups will take place at Shooters in Racine.   I will, however, travel to you if our deal involves a trade.

Any questions/comments/concerns please feel free to email.

Thanks for looking, and happy shooting.
